import "./App.css";
import Form from "./Form.js";
import dataJSON from "./data.json";
//import { useState, useEffect } from "react";

function App() {
  let template = {
    title: "Job Application Form",
    fields: [
      {
        title: "First Name",
        type: "text",
        name: "firstname",
      },
      {
        title: "Second Name",
        type: "text",
        name: "secondname",
      },
      {
        title: "Email",
        type: "email",
        name: "email",
      },
    ],
  };

  return (
    <div className="App container">
      <Form template={template} />
    </div>
  );
}

export default App;
